	protected synchronized Document parseURL1(final String url, HttpProxy httpProxy, Map<String, String> cookies) throws Exception {
		int failure = 0;
		Document doc = null;
		while (true) {
			WebClient client = null;
			try {
				BrowserVersion[] versions = { BrowserVersion.INTERNET_EXPLORER_11, BrowserVersion.CHROME, BrowserVersion.FIREFOX_38, BrowserVersion.BEST_SUPPORTED, BrowserVersion.EDGE,
						BrowserVersion.FIREFOX_45, BrowserVersion.INTERNET_EXPLORER };
				client = new WebClient(versions[(int)(versions.length * Math.random())]);
				client.getCookieManager().clearCookies();
				if (cookies != null) {
					for (Map.Entry<String, String> entry : cookies.entrySet()) {
						client.getCookieManager().addCookie(new Cookie("", entry.getKey(), entry.getValue()));
					}
				}
				client.getOptions().setThrowExceptionOnFailingStatusCode(false);
				client.getOptions().setJavaScriptEnabled(false);
				client.getOptions().setCssEnabled(false);
				client.getOptions().setThrowExceptionOnScriptError(false);
				client.getOptions().setTimeout(30 * 1000);
				client.getOptions().setAppletEnabled(true);
				client.getOptions().setGeolocationEnabled(true);
				client.getOptions().setRedirectEnabled(true);
				// 这行代码允许访问HTTPS网站，异常参考http://www.data5u.com/help/article-31.html
				client.getOptions().setUseInsecureSSL(true);

				if (null == httpProxy || null == httpProxy.getProxy()) {
					InetSocketAddress address = (InetSocketAddress) httpProxy.getProxy().address();
					client.getOptions().setProxyConfig(new ProxyConfig(address.getAddress().getHostAddress(), Integer.valueOf(address.getPort())));
				}
				HtmlPage page = client.getPage(url);
				doc = Jsoup.parse(page.getWebResponse().getContentAsString("utf-8"));
				
				if (doc.baseUri().contains("signin.ebay") || doc.html().contains("robot")) { // robot check!!!
					TimeUnit.SECONDS.sleep(120);
					throw new IllegalAccessException("robot check!!!");
				}
				return doc;
			} catch (Exception e) {
				failure++;
				if (failure > 10)
					throw new IllegalAccessException(httpProxy + " " + e.getMessage());
				httpProxy = DynamicIp.getAProxy();
				log.error("connection failure " + failure + " times", e);
				continue;
			} finally {
				if(client != null)
					client.close();
			}
		}
	}

	protected Document parseURL(final String url, HttpProxy httpProxy, Map<String, String> cookies, String refer) throws Exception {
		int failure = 0;
		Document doc = null;
		Connection conn = null;
		conn = Jsoup.connect(url);
		if (null == httpProxy || null == httpProxy.getProxy()) {
			conn = Jsoup.connect(url);
		} else {
			conn = Jsoup.connect(url).proxy(httpProxy.getProxy());
			if (StringUtils.isNotBlank(httpProxy.getUsername()))
				conn = conn.header("Proxy-Authorization", "Basic " + Base64.getEncoder().encodeToString((httpProxy.getUsername() + ":" + httpProxy.getPassword()).getBytes()));
		}
		if (cookies != null) {
			conn = conn.cookies(cookies);
		}
		while (true) {
			try {
				Response response = conn.header("User-Agent", agents[new Random().nextInt(agents.length)])
						.header("Cache-Control", "no-store")
						.header("Connection", "close")
						.header("Accept", "text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8")
						.header("Accept-Encoding", "gzip, deflate, sdch")
						.header("Accept-Language", "zh-CN,zh;q=0.8")
						.header("Referer", refer)
						.timeout(1000 * 20).execute();
				doc = response.parse();
				if (doc.baseUri().contains("signin.ebay")) { // robot check!!!
					TimeUnit.SECONDS.sleep(120);
					throw new IllegalAccessException("robot check!!!");
				}
				return doc;
			} catch (Exception e) {
				failure++;
				if (failure == 3)
					throw new IllegalAccessException(httpProxy + " " + e.getMessage());
				TimeUnit.SECONDS.sleep(10);
				conn = conn.proxy(DynamicIp.getAProxy().getProxy());
				if (cookies != null) {
					conn = conn.cookies(cookies);
				}
				log.error("connection failure " + failure + " times", e.getMessage());
				continue;
			} finally {
			}
		}
	}

